            </div>
            <div className="input-container">
              <label>Password</label>
              <input type="password" />
            </div>
          </div>

        </ModalBody>
        <ModalFooter>
          <Button color="primary" onClick={() => { this.toggle() }}>
            Do Something
          </Button>{' '}
